#!/usr/bin/python2
s = ''

from PIL import Image, ImageDraw, ImageFont
font = ImageFont.truetype("vt323/VT323-Regular.ttf", 32)
img = Image.new("RGB", (65500, 500))
draw = ImageDraw.Draw(img)
for i in range(0, len(s), 5000):
    draw.text((0, i/150),s[i:i+5000],(255,255,255),font=font)
img.save('newcafebabe.jpg')
